import React from 'react'

function Tracks({response}) {
    
    let topten = [];
    let songslist = [];

    if(response !== null){
        for(let i=0 ; i<10 ; i++){
            topten.push(response.data.data[i]);
        }

        topten.forEach(function(item,index){
            console.log(item,index);
        });

        topten.map(
            (items) => {
                return (
                    songslist = <h2>{items.album}</h2>
                );
            }
        )
    }

    return (
        <div>
            
        </div>
    )
}

export default Tracks
